$(document).ready(()=>{$("#add-god-form").submit(a=>{a.preventDefault();$.ajax({url:"/gods/create",method:"POST",data:{pantheon:$("#add-god-pantheon").val(),name:$("#add-god-name").val(),domain:$("#add-god-domain").val()},success:()=>window.location="/storage",error:b=>{$("#add-god-form").attr("class","ui error form");$("#add-god-error-message").text(b.message)}})})});
